    src_dc={}
    src1=[]
    with open(filename1, 'r', encoding='utf-8', errors='ignore') as f:
        myreader = csv.reader(f)
        count=1        
        for my in myreader:
            if count==1:
                src1=my
            count +=1
            if my[0]==hospital_name:
                for i in range(len(my)):
                    src_dc[src1[i]]=my[i]
    return src_dc
